import React from "react";
import '../Assets/Styles/ProjectsComponentStyles.css'


function ProjectsComponent(){
    return(
        <main className="projects-container">
            <div className="btns-container">
                <button className="rama-btn type1">
                    <span className="btn-txt">BackEnd</span>
                </button>
                <button className="rama-btn">
                    <span className="btn-txt">FrontEnd</span>
                </button>
            </div>
        </main>
    )
}

export default ProjectsComponent;
